import React from 'react';
import './components.css';

const Header: React.FC = () => {
  return (
    <header className="header">
      <div className="logo">IMDb</div>
      <nav>
        <ul>
          <li>Menu</li>
          <li>All</li>
          <li>Search</li>
          <li>Watchlist</li>
          <li>Sign In</li>
          <li>EN</li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
